import React, { Component } from "react";
import AddNinja from "./AddNinja";
import Ninjas from "./Ninjas";

export default class App extends Component {
  constructor() {
    this.state = {
      ninjas: [
        {
          name: "hammad",
          age: 21,
          belt: "black"
        },
        {
          name: "maadi",
          age: 22,
          belt: "black"
        }
      ]
    };
  }

  render() {
    return (
      <div className="App">
        <Ninjas ninjas={this.state.ninjas} />
        <AddNinja />
      </div>
    );
  }
}
